import React from 'react'
import './card.css'
function Card({image,title,description,addtocart}) {
  return (
    <div className='card-container'>
        <img  className='img' src={image}/>
        <h3>{title}</h3>
        <p>{description}</p>
        <button onClick={addtocart}>Add to cart</button>
    </div>
  )
}
export default Card
